import React, { useEffect, useState } from 'react';
import { useNavigate } from "react-router-dom";
const Car = () => {

  const navigate = useNavigate();
    const Car = () => {
      navigate("/carBooking");
    };
  
  const [cars, setCars] = useState([]);

  useEffect(() => {


    
  

    // Fetch car data from the API when the component mounts
    fetch('https://rental-portal001.onrender.com/api/api/cars')
      .then((response) => response.json())
      .then((data) => {
        setCars(data);
      })
      .catch((error) => {
        console.error('Error fetching car data:', error);
      });
  }, []);
  const carImages = [
   
    'data:image/jpeg;base64,',
    'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRaBuGY_3Dxw-OIg1utsRNi6V5TzGB6MCI-bg&usqp=CAU',
    'data:image/jpeg;base64,',
    'data:image/jpeg;base64,',
    'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTKa8uTG4QKBGtuaIp0cXxRfB9qWcqvCpmIkw&usqp=CAU',
    'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRooDY0X9bwTAO-g2h3z2OzUbpFTJntSXoHCw&usqp=CAU',
    'url2.jpg',
    'url3.jpg',
    'url2.jpg',
    'url3.jpg',
    'url2.jpg',
    'url3.jpg',

    // Add more car image URLs as needed
  ];


  return (
    <div>
     
      <div className="car-container">
        {cars.map((car) => (
          <div key={car.carId} className="car-card">
              <img src={carImages[cars.indexOf(car)]} alt={car.carName} />
            <h1>{car.carId}</h1>
            <h2>{car. carName}</h2>
            <p>{car.description}</p>
            <p>price:1000</p>
            <button onClick={Car}>Book Now</button>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Car;
